public static String aclsToString(List<ACL> acls) {
  StringBuilder builder = new StringBuilder();
  if (acls == null) {
    builder.append("null ACL");
  } else {
    builder.append('\n');
    for (ACL acl : acls) {
      builder.append(aclToString(acl))
             .append(" ");
    }
  }
  return builder.toString();
}

